def calculate_objective(assignments: Annotated[list[BoxAssignment], Len(5, 5)]) -> int:
    max_box_id = 0
    for i in range(1, N_ITEM_BOX_ASSIGNMENTS + 1):
        box_id = assignments[i].box_id
        if box_id > max_box_id:
            max_box_id = box_id
    return max_box_id

